import zlib

def decode_flate_stream(hex_data):
    """
    Decode a FlateDecode stream from PDF hex data
    
    Args:
        hex_data (str): Hexadecimal string representation of the compressed data
    
    Returns:
        str: Decoded text content
    """
    try:
        # Remove any whitespace and newlines
        clean_hex = ''.join(hex_data.split())
        
        # Convert hex string to bytes
        compressed_data = bytes.fromhex(clean_hex)
        
        # Decompress using zlib (FlateDecode is zlib compression)
        decompressed_data = zlib.decompress(compressed_data)
        
        # Try to decode as UTF-8, fallback to latin-1 if that fails
        try:
            decoded_text = decompressed_data.decode('utf-8')
        except UnicodeDecodeError:
            decoded_text = decompressed_data.decode('latin-1')
        
        return decoded_text
    
    except Exception as e:
        return f"Error decoding: {str(e)}"

